export const OpenModal = (props) => {
    // let modal = document.getElementById("myModal").style.display = "block";

    const { state } = useAppState(0);

    const [isReady, setIsReady] = useState(false);
    const [setHasError] = useState(false);
    const [listCustomers, setListCustomers] = useState([], Array(Customers));

    let props1 = props
    console.log(props1)
    BaseService.fetch(`/diners/${props1.item.id}`).then((rp) => {
        console.log("isReady1", rp.status);
        if (rp.status) {
            const data = rp.data;
            const listCustomers1 = data;
            console.log("isReady1", rp.data);
            setIsReady(true);
            setListCustomers(listCustomers1);
            console.log("isReady2---", isReady, listCustomers1, listCustomers, state);
        } else {
            setIsReady(true);
            setHasError(true);
            console.log("Messages: " + rp.Messages);
            console.log("Exception: " + rp.Exception);
        }
    });
    return (
        <div id="myModal" class="modal">

          <div class="modal-content">
            <div>
              <div id="Xclose" >
                <img src="https://img.icons8.com/ios-glyphs/30/000000/delete-sign.png" />
              </div>
            </div>
            <div id="propertis">
              {/* <CustomersView Customers={listCustomers}/> */}
            </div>
            <div>
              <button class="close" onClick={() => closeModal()}>
                אישור
              </button>
            </div>
          </div>
        </div>
    )

}

const Price = (priceAll) => {
    if (priceAll.priceAll) {
        return (
            <div>
                {priceAll.priceAll + "₪"}
            </div>
        )
    }
    else {
        return (
